var app=angular.module("mshhllApp",["ngAnimate","ngRoute"]);app.config(["$routeProvider",function(o){o.when("/project",{templateUrl:"views/project.htm"}).otherwise({redirectTo:"/index.html"})}]),app.controller("mainController",["$scope","$http","$location","$rootScope","$routeParams",function(o,t,e,r,n){o.search=n,t.get("json/data.json").then(function(t){o.projects=t.data,n.Id&&angular.forEach(o.projects,function(t){t.id==n.Id&&(o.project=t)})})}]);